import React from "react";

function Note(props) {
  function handleClick() {
    props.delete(props.title);
  }
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button type="button" onClick={handleClick} class="btn btn-outline-danger">Danger</button>
    </div>
  );
}

export default Note;
